<span class="line"><span style="color:#F97583;">for</span><span style="color:#E1E4E8;"> epo </span><span style="color:#F97583;">in</span><span style="color:#79B8FF;"> range</span><span style="color:#E1E4E8;">(num_epochs):</span></span>
